import React from 'react'

const InputComponent = (props) => {
    return (
        <div className=''>
            <input
                name={props.name}
                type={props.type}
                value={props.value}
                placeholder={props.placeholder}
                onChange={props.onChange} />
        </div >
    )
}

export default InputComponent
